import React from "react";

export class NavbarTweet extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <nav className="navbar bg-twitter-5">
                <a className="navbar-brand">Tweet</a>
                <form className="form-inline">
                    <input className="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search"/>
                        <button className="btn btn-twitter-4 my-2 my-sm-0" type="submit">Search</button>
                </form>
            </nav>
        );
    }
}
